function ExpenseItem () {
    return (
        <div>
            <div>Date: July 5th</div>
            <div>
                <h2>Description: Breakfast</h2>
                <div>Amount: $2.30</div>
            </div>
        </div>
    );
}

export default ExpenseItem;
